			"public": null,
			"recipientUserIds": null,
			"respondingToPhraseId": null,
			"responsePhraseId": null,
			"text": "Al brings a wealth of experience to Financial Network. His depth of experience with a variety of securities organizations can only help us improve our already strong compliance culture.",
			"title": "Deep Thought",
			"type": null,
			"url": null,
			"clientId": "jack_handey",
