			"numberOfTimesHeard": null,
			"public": null,
			"recipientUserIds": null,
			"respondingToPhraseId": null,
			"responsePhraseId": null,
			"text": "Ambition is like a frog sitting on a Venus Flytrap. The flytrap can bite and bite, but it won't bother the frog because it only has little tiny plant teeth. But some other stuff could happen and it could be like ambition.",
			"title": "Deep Thought",
			"type": null,
			"url": null,
