			"numberOfTimesHeard": null,
			"public": null,
			"recipientUserIds": null,
			"respondingToPhraseId": null,
			"responsePhraseId": null,
			"text": "Any man, in the right situation, is capable of murder. But not any man is capable of being a good camper. So, murder and camping are not as similar as you might think.",
			"title": "Deep Thought",
			"type": null,
			"url": null,
