			"public": null,
			"recipientUserIds": null,
			"respondingToPhraseId": null,
			"responsePhraseId": null,
			"text": "Anybody who has an identity problem had better wise up and get with the program!",
			"title": "Deep Thought",
			"type": null,
			"url": null,
			"clientId": "jack_handey",
			"userId": "230",
