			"numberOfTimesHeard": null,
			"public": null,
			"recipientUserIds": null,
			"respondingToPhraseId": null,
			"responsePhraseId": null,
			"text": "Consider the daffodil. And while you're doing that, I'll be over here, looking through your stuff.",
			"title": "Deep Thought",
			"type": null,
			"url": null,
			"clientId": "jack_handey",
