			"numberOfTimesHeard": null,
			"public": null,
			"recipientUserIds": null,
			"respondingToPhraseId": null,
			"responsePhraseId": null,
			"text": "I believe in making the world safe for our children, but not our children's children, because I don't think children should be having sex.",
			"title": "Deep Thought",
			"type": null,
			"url": null,
			"clientId": "jack_handey",
