			"public": null,
			"recipientUserIds": null,
			"respondingToPhraseId": null,
			"responsePhraseId": null,
			"text": "I bet for an Indian, shooting an old fat pioneer woman in the back with an arrow, and she fires her shotgun into the ground as she falls over, is like the top thing you can do.",
			"title": "Deep Thought",
			"type": null,
			"url": null,
